import React from 'react';
import './App.css';

class App extends React.Component {
  render() {
    const album01 = {
      title: 'The Dark Side of the Moon',
      artist: 'Pink Floyd',
      releaseYear: 1973,
      imagem:"https://upload.wikimedia.org/wikipedia/en/3/3b/Dark_Side_of_the_Moon.png",
      releaseDate: {
        day: 23,
        month: 'February',
        year: 1985
      },
      others: {
        recordCompany: "Compilot Parloni",
        formats: ["CD", "Vinil", "Digital"],
        goldStatus: true
      }
    }
    return (
      <div className="App">
        <h1>{album01.map((top, index) => (
          <p key={index}></p>
        ))}</h1>
      </div>
    );
  }
}

export default App;
